import React, {Component} from 'react';
import ResponsiveMenu from 'react-responsive-navbar';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="Nav-Bar">
        <div> 
          <a>Work</a>
          <a>UI Design</a>
          <a>Visual Design</a>
          <a>About</a>
        </div>
      </header>
      <p className="Name">
      hello, <br/>
      i'm augustina!
      </p>
      <p className="Intro"> 
        a senior studying Human Centered Design and Engineering at the University of Washington. <br/>
        I empower users with different levels of abilities by seeking and considering their <br/>
        needs and desires.
      </p>
    </div>
  );
}

export default App;
